; (function($) {
var ie = $.browser.msie && $.browser.version < 8.0;
$.fn.menu = function() {
  $(this).find('li').each(function() {
    if ($(this).find('> ul').size() > 0) {
      $(this).addClass('has_child');
    }
  });
  
  var closeTimer = null;
  var menuItem = null;
  
  function cancelTimer() {
    if (closeTimer) {
      window.clearTimeout(closeTimer);
      closeTimer = null;
    }
  }
  
  function close() {
    $(menuItem).find('> ul ul').hide();
    //ie ? $(menuItem).find('> ul').fadeOut() : $(menuItem).find('> ul').slideUp(250);
    $(menuItem).find('> ul').fadeOut(300);
    menuItem = null;
  }
  var config = {
    over: function(){
        cancelTimer();
        var parent = false;
        $(this).parents('li').each(function() { 
          if (this == menuItem) parent = true;
        });
        if (menuItem != this && !parent) close();
            
        $(this).addClass('hover',300);
        //ie ? $(this).find('> ul').fadeIn() : $(this).find('> ul').slideDown(250);
        $(this).find('> ul').fadeIn(300);
      },    
      timeout: 0,   
      out: function(){
        $(this).removeClass('hover',300);
        menuItem = this;
        cancelTimer();
        closeTimer = window.setTimeout(close, 500);
      } 
    };
  $do = $(this).find('li')
  function do_menu() {
    if(jQuery( window ).width() > 959) {
      $do.hoverIntent( config );
      jQuery('#navigation').show();
    }
    else {
      $do.unbind("mouseenter").unbind("mouseleave");
      $do.removeProp('hoverIntent_t');
      $do.removeProp('hoverIntent_s');
    }
  }
  do_menu();
  if (ie) {
    $(this).find('ul a').css('display', 'inline-block');
    $(this).find('ul ul').css('top', '0');
  }
  jQuery(window).smartresize(function() {
    do_menu();
    jQuery('.my-sub-menu').hide();
    jQuery('.mobile-sub-menu-controller').removeClass('active');
  });
}

})(jQuery);

